import React from 'react';

interface Address {
  cep: string;
  logradouro: string;
  bairro: string;
  localidade: string;
  uf: string;
}

interface AddressListProps {
  addresses: Address[];
}

const AddressList: React.FC<AddressListProps> = ({ addresses }) => {
  return (
    <div className="p-4 bg-white shadow-md rounded-lg mt-4">
      <h2 className="text-xl font-bold mb-4">Endereços Salvos</h2>
      {addresses.length === 0 ? (
        <p>Nenhum endereço salvo.</p>
      ) : (
        <ul>
          {addresses.map((address, index) => (
            <li key={index} className="border-b border-gray-200 py-2">
              <p>
                <strong>CEP:</strong> {address.cep}
              </p>
              <p>
                <strong>Logradouro:</strong> {address.logradouro}
              </p>
              <p>
                <strong>Bairro:</strong> {address.bairro}
              </p>
              <p>
                <strong>Cidade:</strong> {address.localidade}, {address.uf}
              </p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default AddressList;
